  $templateCache.put("pages/articles/_cash-gift.html", "<div class=\"article-content\">\n  <div class=\"article-section\">\n    <p>\n      “千”呼万唤始出来，薪酬翻倍轻松赚\n    </p>\n\n    <p>\n      选择加入弥财，注册验证并预约产品，除了送您一张<span class=\"redHighlight\">20元京东E卡</span>外，每出一单都多给您<span class=\"redHighlight\">1000</span>块奖励。\n    </p>\n\n    <p>\n      不以佣金论英雄，高额奖金拿报酬。游荡江湖，不如停驻于此，同样是寒冬，弥财的炉火更温暖。\n    </p>\n\n    <p>\n      现在牵手弥财，让我们共度难关，将产品上传到弥财，你的饭碗我们帮你保，通过弥财成功预约产品，薪酬翻倍轻松赚。\n    </p>\n  </div>\n\n  <div class=\"article-section\">\n    <h3>奖励规则</h3>\n    <p>\n      在弥财平台销售的任意一款产品，按成交金额可以获得相应奖金。具体如下：\n    </p>\n    <img src=\"public/cash-gift-rule.png\">\n    <p>\n      花一天才能找到的产品，在弥财“搜”一下，在上千产品中，有惊喜也说不定。\n      <br>\n      <a ng-click=\"vm.onClickSearchProducts()\">点击搜索 &gt;&gt;</a>\n    </p>\n  </div>\n\n  <div class=\"article-section\">\n    <h3>参与规则</h3>\n    <ul>\n      <li>\n        在弥财平台成功预约产品并认证成功的理财师均可参加（同一手机号、同一名片视为同一个人）；\n      </li>\n      <li>\n        订单交易成功后，弥财承诺，预约项目成立后24小时内佣金与奖金到账；\n      </li>\n      <li>\n        佣金与奖金单独结算，具体佣金见产品页面（为税后佣金），奖金部分以上表为准，奖金为税前费用，税费为3%。\n      </li>\n    </ul>\n  </div>\n\n  <div class=\"article-section\">\n    <h3>\n      截止日期\n    </h3>\n    <p>\n      2016年10月7日\n    </p>\n  </div>\n  <div class=\"article-section\">\n    <h3>常见问题</h3>\n\n    <p style=\"margin-top: 18px\">\n      <span class=\"highlight\">\n        ❶ 如何获得奖金？\n      </span>\n      <br>\n      在弥财的平台进行名片认证后，成功预约弥财指定产品。项目成立后，佣金与奖金会在24小时内打入您的账户。\n    </p>\n\n    <p>\n      <span class=\"highlight\">\n        ❷ 如何定义交易成功？\n      </span>\n      <br>\n      交易成功，即在项目成立前，提交三件套以及签约合同文件（扫描件）。请注意，单是合同签订不视为交易成功。\n    </p>\n\n    <p>\n      <span class=\"highlight\">\n        ❸ 如何领取佣金与奖金？网上直接转账还是怎样？\n      </span>\n      <br>\n      项目成立第二天，您可以直接通过我的中心查看您的佣金数额，点击数字，绑定银行卡后，佣金可以随时提现。注意，我的中心界面只显示您的佣金，奖金部分会通过电话确认后单独打到您的个人账户。\n    </p>\n\n    <p>\n      <span class=\"highlight\">\n        ❹ 奖金会根据佣金的不同有变化吗，我如何检测佣金与奖金的入账？\n      </span>\n      <br>\n      奖金部分与佣金部分是分开结算的，您账户的钱数可以在个人中心中随时查看。\n    </p>\n  </div>\n\n  <div class=\"advertise-note\">\n    * 本次活动最终解释权归北京弥财投资咨询有限公司所有。有任何问题，请随时联系我们。\n  </div>\n</div>\n");
  $templateCache.put("pages/articles/_features.html", "<div class=\"article-content\">\n  <h2 class=\"head-title\">\n    弥财平台优势介绍\n  </h2>\n\n  <div class=\"article-section\">\n    <h3>\n      佣金高\n    </h3>\n    <p>\n      跟传统行业相比，弥财直接与产品发行方对接，无中间环节，为理财顾问提供一站式的高佣金、高效率的金融服务。\n    </p>\n    <p>\n      传统：产品发行方 → 中间商1 → 中间商2 → 中间商3 → 用户\n      <br>\n      弥财：产品发行方 → 用户\n    </p>\n    <p>\n      我们极力为你打造一个更开放、透明的金融平台，每年你将为家庭多赚取10倍以上的佣金。\n    </p>\n    <img src=\"public/advantage-compare-fee.png\">\n  </div>\n\n  <div class=\"article-section\">\n    <h3>\n      产品全\n    </h3>\n    <p>\n      弥财的金融和风控团队经验丰富，平均工作资历达10年，有来自学术界楷模的哥伦比亚大学Geert Bekaert教授，多年私人银行与财富管理经验的弥财金融产品总监崔海楠, 建信基金海外投资部总监赵英楷。在成千上万的金融产品中，他们为平台层层甄选多品类、优质的金融产品，满足不同用户需求。\n    </p>\n    <img src=\"public/risk-flow.png\">\n  </div>\n\n  <div class=\"article-section\">\n    <h3>结佣快</h3>\n\n    <p>\n      数千万资金储备，为您提供实时佣金检测，24小时内佣金极速到账。\n    </p>\n    <img src=\"public/transaction-fee.jpg\">\n  </div>\n\n  <div class=\"article-section\">\n    <h3>\n      实力强\n    </h3>\n    <p>\n      我们与国内外实力雄厚的金融机构合作，为平台第一时间拿到优质产品。我们的合作机构如下（部分筛选）：\n    </p>\n    <img src=\"public/risk-friends.png\">\n  </div>\n</div>\n");
  $templateCache.put("pages/articles/_flight-gift.html", "<div class=\"article-content\">\n  <div class=\"article-section gift-intro\">\n    <span class=\"highlight\">☀ 礼包一 ☀</span>\n    <br>\n    手机号注册并通过理财顾问身份验证\n    <br>\n    可获得 <span class=\"highlight\">50 元京东购物卡</span>\n    <br>\n    (购物卡将以短信的形式发送给您)\n\n    <br>\n    <br>\n\n    <span class=\"highlight\">☀ 礼包二 ☀</span>\n    <br>\n    <span class=\"highlight\">私人包机服务，鸟瞰北京城</span>\n    <br>\n    我们会从所有验证成功的理财顾问当中 <span class=\"highlight\">抽取 5 名幸运小伙伴</span>\n    <br>\n    一起体验私人飞机的空中之旅\n    <br>\n    和他们一起在3000米的高空重新定义这座城市\n\n    <br>\n    <br>\n\n    活动时间：2016年6月 - 7月31日\n    <br>\n    谁能参加：通过身份验证的地球人、火星人都可以；\n    <br>\n    何时公布抽奖：我们将在7月15日公布获奖名单\n\n    <br>\n    <br>\n    <br>\n\n    ▽\n    <br>\n    (私人飞机体验服务介绍)\n    <br>\n\n  </div>\n\n  <p class=\"highlight\">\n    “尊敬的乘客，您的私人豪华飞机即将起航，您准备好了吗？”\n  </p>\n  <img src=\"public/flight-ready.jpeg\">\n\n  <p>\n    西锐SR20是一架高性能单发4座复合型飞机（1位教练＋3位乘客），因性能出众被美国空军选为教练飞机，马力是普通客机的3倍，最主要的是西锐SR22最大特点是使用了西锐整机降落伞系统，在发生紧急情况时实现安全降落。\n    <span class=\"highlight\">空中宝马，稳扎稳打，给你最安稳的刺激体验。</span>\n  </p>\n  <img src=\"public/flight-seat.jpeg\">\n\n  <p>\n    <span class=\"highlight\">\n      当然，作为你的专属飞机，就听你的，你可以：\n    </span>\n    <br>\n    前排试驾：无需驾照＋体验驾驶＋一代天骄尽在掌握\n    <br>\n    后排观光：尽情拍照＋失重升级＋空中爱情孕育温床\n  </p>\n  <img src=\"public/flight-view.jpeg\">\n\n  <p>\n    <span class=\"highlight\">飞行模式，此模式非彼模式，当然从楼上扔下去的情况除外。</span>\n    完整五边飞行 （模拟飞行的最标准模式）\n  </p>\n\n  <p>\n    <span class=\"highlight\">同时，拥有三大特技：</span>\n    <br>\n    特技1 大坡度盘旋：可参考海盗船开在空中同时360度旋转\n    <br>\n    特技2 跃升超重：可参考被超人抱在怀里飞向宇宙\n    <br>\n    特技3 自由落体：可参考从北京中央广播电视塔塔尖跳下来\n  </p>\n  <img src=\"public/flight-feature.jpeg\">\n\n  <p>\n    温馨提示：同一个客户只能以个人首次通过验证的账号参与本次活动，以下情形视为同一客户：同一个手机号，同一个名片等\n  </p>\n\n  <div class=\"advertise-note\">\n    * 本次活动最终解释权归北京弥财投资咨询有限公司所有。有任何问题，请随时联系我们。\n  </div>\n\n</div>\n");
